import React from 'react';

class Weakness extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        if(this.props.type1 == 0){
            return (
                <td></td>
            )
        }
        return (
        <td>{this.props.type1}, {this.props.type2}</td>
        );
    }
};

export default Weakness;
